import React from "react";
import "./List.scss"; // Make sure to import your List component's stylesheet
import Card from "../Card/Card"; // Import the Card component
import useFetch from "../../hooks/useFetch";

const List = () => {
  // Define your data array with product information
  const data = [
    {
      id: "1",
      img: 'https://images.unsplash.com/photo-1618220179428-22790b461013?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=327&q=80',
      img2: 'https://unsplash.com/es/fotos/wO_60Luq_o0',
      title: 'Product Title 1',
      isNew: true,
      oldPrice: 10.99,
      newPrice: 7.99
    },
    {
      id: "2",
      img: 'path/to/image2.jpg',
      img2: 'path/to/image2.jpg',
      title: 'Product Title 2',
      isNew: true,
      oldPrice: 10.99,
      newPrice: 7.99
    },
    // Add more product data objects as needed
  ];

  return (
    <div className="list">
      {/* Map through the data array and render the Card component for each item */}
      {data.map(item => (
        <Card item={item} key={item.id} />
      ))}
    </div>
  );
}

export default List;
